import React, { useState, useEffect } from "react";
import Header from "../components/Header";

export default function Contact() {
  const [trackDetails, setTrackDetails] = useState(null);

  useEffect(() => {
    const fetchTrackDetails = async () => {
      try {
        const accessToken = "DIN_ACCESS_TOKEN_HÄR";
        const trackId = "0pqnGHJpmpxLKifKRmU6WP";
        const response = await fetch(
          `https://api.spotify.com/v1/tracks/${trackId}`,
          {
            method: "GET",
            headers: {
              Authorization: `Bearer ${accessToken}`,
            },
          },
        );

        if (!response.ok) {
          throw new Error("Failed to fetch track details");
        }

        const data = await response.json();
        setTrackDetails(data);
      } catch (error) {
        console.error("Error fetching track details:", error);
      }
    };

    fetchTrackDetails();
  }, []); // Körs bara en gång när komponenten monteras

  return (
    <>
      <Header />
      <h2>Contact Page</h2>
      {trackDetails && (
        <div>
          <h3>Track Details</h3>
          <p>Title: {trackDetails.name}</p>
          <p>Artist: {trackDetails.artists[0].name}</p>
          <p>Album: {trackDetails.album.name}</p>
          {/* Visa övriga detaljer om låten om det behövs */}
        </div>
      )}
    </>
  );
}
